"use strict"
// Video
const els = Array.from(document.querySelectorAll('.video'))
els.forEach((el) => {
    /* eslint-disable-next-line */
    const gallery = lightGallery(el, {
        download: false,
        zoom: false,
        selector: '.video-link'
    })
})

// Form file
const attacheEl = document.querySelector('.form-attache')
const filesEl = document.querySelector('.form-files')
const fileEl = document.querySelector('.form-file')
const _files = []
const maxFiles = 10
const arrayChangeHandler = {
    get(target, property) {
        return target[property]
    },
    set(target, property, value, receiver) {
        target[property] = value
        renderFiles()
        return true
    }
}
const files = new Proxy(_files, arrayChangeHandler)

function renderFiles() {
    let html = ''
    files.forEach((file, i) => {
        html += `<li class="form-files-item" data-index="${i}">
        <span>${file.name}</span>
        <button class="form-files-remove" type="button"></button>
      </li>`
    })
    filesEl.innerHTML = html
}

filesEl.addEventListener('click', (e) => {
    if (!e.target.matches('.form-files-remove')) {
        return
    }
    const parentEl = e.target.closest('.form-files-item')
    const index = +parentEl.dataset.index
    files.splice(index, 1)
})
fileEl.addEventListener('change', (e) => {
    for (const file of e.target.files) {
        if (files.length === 10) {
            alert(`You can only upload a maximum of ${maxFiles} files`)
            break
        }
        files.push(file)
    }
})

// Form validation
const forms = document.querySelectorAll('.needs-validation')
Array.prototype.slice.call(forms)
    .forEach(function (form) {
        form.addEventListener('submit', function (event) {
            if (!form.checkValidity()) {
                event.preventDefault()
                event.stopPropagation()
            }

            form.classList.add('was-validated')
        }, false)
    })

// Modal
window.orderModal = new bootstrap.Modal(document.getElementById('modalOrder'))
const orderModalSuccessEl = document.getElementById('modalOrderSuccess')
const orderModalErrorEl = document.getElementById('modalOrderError')
window.orderModalSuccess = new bootstrap.Modal(orderModalSuccessEl)
window.orderModalError = new bootstrap.Modal(orderModalErrorEl)
orderModalSuccessEl.addEventListener('show.bs.modal', function (event) {
    orderModal.hide()
})
orderModalErrorEl.addEventListener('show.bs.modal', function (event) {
    orderModal.hide()
})